function CostItem({ item }) {
  const { name, date, price } = item;

  return (
    <div class="container">
  <div class="row">
    <div class="element1">Элемент 1</div>
    <div class="element2">Элемент 2</div>
  </div>
  <div class="element3">Элемент 3</div>
</div>

  );
}

export default CostItem;
